import React, { Component } from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import About from './about';
import Portfolio from './portfolio';
import Resume from './resume';
import Home from './home';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import ReactDOM from 'react-dom';

class NavBar extends Component {

    render(){
        return (
            <Router>
                {/* <Navbar collapseOnSelect expand="lg" bg="light">
                    <Navbar.Brand  href='/'>Eleanor Rumsey Designs</Navbar.Brand>
                    <Navbar.Toggle aria-controls="responsive-navbar-nav" />
                    <Navbar.Collapse id="responsive-navbar-nav">
                        <Nav>
                            <Nav.Link href="/about">About</Nav.Link>
                            <Nav.Link href="/portfolio">Portfolio</Nav.Link>
                            <Nav.Link href="/resume">Resume</Nav.Link>
                        </Nav>
                        <Nav>
                            <Nav.Link href="https://github.com/eleanorRumsey"><i class="fab fa-github"></i></Nav.Link>
                            <Nav.Link href="https://www.linkedin.com/in/eleanorrumsey/"><i class="fab fa-linkedin"></i></Nav.Link>
                        </Nav>
                    </Navbar.Collapse>
                </Navbar> */}
                <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
  <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
  <Navbar.Toggle aria-controls="responsive-navbar-nav" />
  <Navbar.Collapse id="responsive-navbar-nav">
    <Nav className="mr-auto">
      <Nav.Link href="#features">Features</Nav.Link>
      <Nav.Link href="#pricing">Pricing</Nav.Link>
      <NavDropdown title="Dropdown" id="collasible-nav-dropdown">
        <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.2">Another action</NavDropdown.Item>
        <NavDropdown.Item href="#action/3.3">Something</NavDropdown.Item>
        <NavDropdown.Divider />
        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
      </NavDropdown>
    </Nav>
    <Nav>
      <Nav.Link href="#deets">More deets</Nav.Link>
      <Nav.Link eventKey={2} href="#memes">
        Dank memes
      </Nav.Link>
    </Nav>
  </Navbar.Collapse>
</Navbar>
                <Switch>
                    <Route path = '/about' component={About}/>
                    <Route path = '/portfolio' component={Portfolio}/>
                    <Route path = '/resume' component={Resume}/>
                    <Route path = '/' component={Home}/>
                </Switch>
            </Router>
        );
    }
}



export default NavBar;
